// so seo friendly kyki insepect element me u can see the loaded content
import Link from 'next/link';
import {useState,useEffect} from 'react';
const Home=()=>{
  const [data,setdata]=useState('..load');
  useEffect(()=>{
    fetch('http://localhost:3030/api/test').then(res=>res.json()).then(data=>{
    setdata(data);
    })
  })
return (
  <>
  <h1>Hi there this is next Js</h1>
  <h2>{data}</h2>
  <Link href='/product'><a>Go to Products</a></Link>
  </>
)
}
export default Home;
